import React from 'react';

// import { Container } from './styles';

function Explore3Buttons({ area }) {
  return (
    <div>
      <button
        type="button"
        data-testid="explore-by-ingredient"
      >
        Por Ingredientes
      </button>

      { area
        ? <button
          type="button"
          data-testid="explore-by-area"
        >
          Por Local de Origem
        </button>
        : '' }
      <button
        type="button"
        data-testid="explore-surprise"
      >
        Me Surpreenda!
      </button>
    </div>
  );
}

export default Explore3Buttons;
